met Kate Hudson, Matthew McConaughey en Donald Sutherland

Tess en Ben Finnagan zijn een getrouwd koppel dat hun geld verdient met het zoeken naar schatten. Helaas hebben ze al jaren 
niets meer gevonden en zitten ze dus ook aan de rand van bankroet. Als gevolg daarvan loopt hun huwelijk ook niet bepaald 
soepel meer en ze besluiten een scheiding aan te vragen. Maar op dat moment komen ze in aanraking met een aanwijzing die leidt 
naar een enorme schat...
